import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'
import Link from 'next/link'

const Home = () => {

    () => {
        fetch('https://api.myanimelist.net/v2/anime/ranking?ranking_type=all&limit=20').then(res => res.json())
    }

    // async() => {
    //     data = await axios.get('https://api.myanimelist.net/v2/anime/ranking?ranking_type=all&limit=20')
    //     console.log(JSON.stringify(data))
    // }
    

    return (
        <div className='ml-2'>
            <h1 className='text-primary'>Sora</h1>
            <div>
                <Link href='/Wen'>My Media List</Link>
            </div>
        </div>
)}

export default Home
